// src/pages/Dashboard.js
import React, { useState } from "react";
import { Button, Card, Spinner, Alert } from "react-bootstrap";
import axios from "axios";
import { motion } from "framer-motion";

const API_URL = "http://127.0.0.1:8000";

const Dashboard = () => {
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState("");
  const [error, setError] = useState("");
  const [file, setFile] = useState(null);

  const token = localStorage.getItem("token");

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleDetectObjects = async () => {
    if (!file) return setError("Please upload an image first!");
    setError("");
    setMessage("");
    setLoading(true);

    try {
      const formData = new FormData();
      formData.append("image", file);

      const res = await axios.post(`${API_URL}/detect-batch`, formData, {
        headers: {
          Authorization: `Bearer ${token}`,
          "Content-Type": "multipart/form-data",
        },
      });

      setMessage("‚úÖ Object detection completed successfully!");
      console.log("Detection response:", res.data);
    } catch (err) {
      console.error(err);
      setError("‚ùå Detection failed. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  const handleGenerate3DScene = async () => {
    if (!file) return setError("Please upload an image first!");
    setError("");
    setMessage("");
    setLoading(true);

    try {
      const formData = new FormData();
      formData.append("image", file);
      formData.append("detection_method", "auto");

      const res = await axios.post(`${API_URL}/3d-scene-map`, formData, {
        headers: {
          Authorization: `Bearer ${token}`,
          "Content-Type": "multipart/form-data",
        },
      });

      setMessage("‚úÖ 3D Scene Map generated successfully!");
      console.log("3D Scene response:", res.data);
    } catch (err) {
      console.error(err);
      setError("‚ùå 3D Scene generation failed.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="flex min-h-screen">
      {/* Sidebar */}
      <div className="w-1/5 bg-dark text-white p-4 fixed top-0 left-0 h-full">
        <h3 className="text-xl font-bold mb-4">AI Vision Dashboard</h3>
        <div className="space-y-3">
          <p className="hover:text-primary cursor-pointer">üè† Dashboard</p>
          <p className="hover:text-primary cursor-pointer">üìÅ Uploads</p>
          <p className="hover:text-primary cursor-pointer">‚öôÔ∏è Settings</p>
        </div>
      </div>

      {/* Main Content */}
      <motion.div
        className="flex-1 ml-[20%] p-5 bg-light min-h-screen"
        initial={{ opacity: 0, x: 30 }}
        animate={{ opacity: 1, x: 0 }}
        transition={{ duration: 0.6 }}
      >
        <div className="d-flex justify-content-between align-items-center mb-4">
          <h2 className="fw-bold">Dashboard</h2>
          <img
            src="https://cdn-icons-png.flaticon.com/512/3135/3135715.png"
            alt="profile"
            width="40"
            height="40"
            className="rounded-circle border border-secondary"
          />
        </div>

        <Card className="shadow-sm p-4">
          <h5 className="mb-3 fw-bold">Upload an Image</h5>
          <input type="file" className="form-control mb-3" onChange={handleFileChange} />

          <div className="d-flex gap-3">
            <Button
              variant="primary"
              onClick={handleDetectObjects}
              disabled={loading}
            >
              {loading ? (
                <>
                  <Spinner animation="border" size="sm" /> Detecting...
                </>
              ) : (
                "üîç Detect Objects"
              )}
            </Button>

            <Button
              variant="success"
              onClick={handleGenerate3DScene}
              disabled={loading}
            >
              {loading ? (
                <>
                  <Spinner animation="border" size="sm" /> Generating...
                </>
              ) : (
                "üó∫Ô∏è Generate 3D Scene"
              )}
            </Button>
          </div>

          {error && <Alert variant="danger" className="mt-3">{error}</Alert>}
          {message && <Alert variant="success" className="mt-3">{message}</Alert>}
        </Card>
      </motion.div>
    </div>
  );
};

export default Dashboard;
